VALUES
	('086b6c7379ad4cc9aa38f2980c7641df','2cfee717036b44968c23f51dc1ee0c26','JAYJUN','/upload/00e600a0a7de4d158098e54982608598/51c174ec219040298edcc57d5e7748a1.png','(株)JAYJUN COSMETIC是韩国化妆品公司，于2014年11月15日在首尔创立，总部设于韩国首尔江南区论岘路528号。JAYJUN坚持以“Responsible for Beauty(为美丽负责)”为座右铭，一直坚持“美丽至上、客户至上”的服务理念。提出了克服老化的美丽新概念，专注为女性解决肌肤老化暗沉等问题。并运用先进科技，不断对品牌进行提升，追求自然与肌肤的完美融合。','','00e600a0a7de4d158098e54982608598','2016-10-25 16:03:31','00e600a0a7de4d158098e54982608598','2016-10-25 16:03:31',1),
	('0ee26097db0a43d8864cac0f9f898595','de8776f532034125ba594b72529f86b4','希思黎','/upload/00e600a0a7de4d158098e54982608598/b474ebc947ce49ec964ca291cb2a3da1.png','sisley诞生于充满浪漫气息的法国，在1976年由法国修伯特．多纳诺伯爵创立，以当时欧洲的植物美容学为基础，成功地研创出来的植物性护肤品牌。在全球享有盛誉，是护肤品中尊贵与优雅的经典代表。sisley所有产品均以植物萃取精华与植物香精油作为主要成分，配以独特配方研制而成，并坚持产品在上市前必须经过300名皮肤科医师的测试，包装上必须名符其实地被许可标示“经过敏与敏感测试”及出自法国原厂。','','00e600a0a7de4d158098e54982608598','2016-09-20 13:59:43','00e600a0a7de4d158098e54982608598','2016-10-25 14:35:27',1),
	('1cfca94e7ad7437696f768ac41a7164e','cc797d97895d4363ad231bad0429815f','资生堂','/upload/00e600a0a7de4d158098e54982608598/91778484958b4fde84c6d22769ea29da.jpg','于1872年日本,高端化妆品品牌,致力于美肌和秀发的研究,EUDERMINE红色蜜露化妆水享誉全球,资生堂(中国)投资有限公司','<div>\n<div>资生堂（中国）投资有限公司，创始于1872年日本，高端化妆品品牌，以西洋药学处方为基础，致力于美肌和秀发的研究，EUDERMINE红色蜜露化妆水享誉全球</div>\n<div>&nbsp;</div>\n<div>SHISEIDO资生堂，是日本著名的化妆品品牌。取名源自中文《易经》中的&ldquo;至哉坤元，万物资生&rdquo;，资生堂的涵义为孕育新生命，创造新价值。&ldquo;至哉坤元，万物资生&rdquo;意为&ldquo;赞美大地的美德，她哺育了新的生命，创造了新的价值。&rdquo;这一名称正是资生堂公司形象的反映，是将东方的美学及意识与西方的技术及商业实践相结合的先，将先进技术与传统理念相结合，用西方文化诠释含蓄的东方文化。</div>\n<div>1872年资生堂在日本东京银座创立了第一家西式调剂药房。1897年科学性地开发出了以西洋药学处方为基础，名为红色蜜露（EUDERMINE）的化妆水。从此，资生堂便一直致力于美肌和秀发的研究，研发出了许多革新商品和美容方法。</div>\n<div>资生堂中国</div>\n<div>1981年北京市&ldquo;友谊商店&rdquo;、&ldquo;北京饭店&rdquo;等9家大型商场、饭店开始销售约60个品种的资生堂化妆品、香皂、牙刷用具等产品。</div>\n<div>1983年资生堂与北京签署第一次生产技术协作协议，开始销售当地开发品牌&ldquo;华姿&rdquo;产品。</div>\n<div>1985年资生堂与北京签署第二次生产技术协作协议，生产销售护肤品。</div>\n<div>1986年资生堂与北京签署第三次生产技术协作协议。</div>\n<div>1991年资生堂与北京签署第四次生产技术协作协议，成立合资公司资生堂丽源化妆品有限公司，开始百货店事业。</div>\n<div>1993年北京工场竣工。</div>\n<div>1994年合资品牌&ldquo;欧珀莱&rdquo;（AUPRES）开始销售。</div>\n<div>1998年合作公司上海卓多姿中信化妆品有限公司成立。</div>\n<div>2000年欧珀莱防晒系列被指定为悉尼奥运会中国体育代表团的专用防晒护肤产品。</div>\n<div>2001年独资公司资生堂（中国）研究开发中心有限公司成立。</div>\n<div>2002年资生堂名誉会长福原义春荣获北京市荣誉市民称号。</div>\n<div>2003年资生堂（中国）投资有限公司在上海成立。菲婷资生堂商品上市，超市及便利店专卖正式加入。</div>\n<div>2004年开始资生堂化妆品专门店商务。资生堂成为日本爱知世博会中国馆的主要赞助方。</div>\n<div>2005年资生堂药品株式会社的&ldquo;菲璐泽&rdquo;上市。扩大中国研究开发中心。&ldquo;欧珀莱&rdquo;成为&ldquo;2005-2008年亚运会中国体育代表团化妆品合作伙伴&rdquo;。</div>\n<div>2006年资生堂化妆品专卖店品牌&ldquo;urara悠莱&rdquo;上市。&ldquo;SUPREMEAUPRES思魅欧珀莱&rdquo;上市。</div>\n<div>2009年资生堂携旗下品牌冠名《魔方城市》网站&ldquo;啪啦啪啦&rdquo;操课秀成都站决赛</div>\n<div>2009年资生堂携旗下品牌悠莱、泊美、ZA等品牌旗舰店陆续在国内各大知名B2C商城上开展自己的电子商务模式的经营，淘宝商城、365商城等知名网购平台都有资生堂旗下品牌的品牌店铺</div>\n</div>','00e600a0a7de4d158098e54982608598','2016-09-27 14:22:08','00e600a0a7de4d158098e54982608598','2016-09-27 14:22:08',1),
	('4d4875e1ff0048558631dcf05f34d3f4','cc797d97895d4363ad231bad0429815f','SK-II','/upload/00e600a0a7de4d158098e54982608598/90baf39e55924e349f945f8f4ac0855c.jpg','1909年创始于日本,晶莹透肌护肤精华露素有神仙水美誉,首创独家肌源修护复方,十大护肤品品牌,宝洁公司','<div>\n<div>宝洁（中国）有限公司，SK-II，1909年创于日本，晶莹透肌护肤精华露素有\"神仙水\"美誉，首创独家肌源修护复方，专注于研究亚洲女性肌肤护理的企业</div>\n<div>&nbsp;</div>\n<div>SK-II诞生于日本，是日本皮肤专家将尖端科技运用到护肤品开发中的完美结晶，是目前在日本、香港、台湾、东南亚、韩国及中国等地深受欢迎的护肤品牌。2003年，SK-II将酒红色的旋风吹到欧洲，在英国等地热销。</div>\n<div>SK-II公司创办人MR.MAX FACTOR，在波兰出生，早期从事假发及化妆师的工作，曾在苏俄皇家舞团担任化妆师，19世纪初移民到美国。</div>\n<div>1909年中，SK-II先生在洛杉矶戏院区开设了他第一家戏剧用品店，专售舞台用的专业假发及化妆用品。起初他贩卖德国的剧院化妆品，但因为经常有电影演员像他求教化妆方面的建议，而让他感受到当时新兴的电影事业需要一种全新的化妆技巧。当时演员们用油彩来化妆，脸部的妆在镜头上看就是厚厚的一层浓妆，又泛着油光，显得僵硬不自然，于是SK-II先生发明了一种新配方的膏状彩妆，叫做Flexible Greasepaint （清爽彩妆），这是第一个专为电影拍摄所制作出的化妆用品。由于他可以让演员快速上妆，看起来效果更好、更自然，所以在很短的时间内就得到使用者极佳的回响。从此，SK-II先生即不断地改良、创新，持续推出新产品，他不仅成为化妆品产业的先锋，不断创新，开发新产品，为使用者提供最出色的化妆品，也就成为SK-II公司成立的宗旨。</div>\n<div>浮世情怀</div>\n<div>随后，SK-II又做了一次创举，发表\"浮世情怀彩妆系列（Society Makeup)\"让化妆用品跨出专业化妆室，成为各行各业关心\"美\"的女士都能共享的消费品，美丽不再是明星、艺人的专利，平凡的女性也可以自信地焕发出更光鲜的外表。</div>\n<div>这一系列用品含盖了粉底、蜜粉、腮红、眼影、眼线、眉笔、睫毛膏及修容。遮盖功用的产品，都是依SK-II的&ldquo;和谐色彩&rdquo;概念设计出来的。在互补色彩的调和润饰下，突显出每一种发色或肤色女性的和谐色彩感，让所有女性朋友皆能具备如明星般的光采吸引力。一直到今日，&ldquo;和谐色彩&rdquo;概念仍旧是SK-II发展彩妆产品时不变的信念。</div>\n<div>浮世情怀彩妆系列（Society Makeup）打破了美容的疆界，也为化妆品普及化的第一步写下完美的脚注。在以往，因为\"Make-Up\"这个字眼所代表的意义与演艺界密切相关，而当时人们对演艺圈的印象普遍不好，所以人们常避面使用这个字眼，以免有损自己的形象。SK-II先生是第一个以\"Make -Up\"等字眼为产品命名的人。同时因为浮世情怀彩妆（Society Makeup）系列产品在人们心中占有了代表性的地位，反而导正了\"Make-Up\"让女人以能够仿真明星风采，拥有美丽耀眼为荣。</div>\n<div>领域扩张</div>\n<div>从彩妆进入保养护肤领域：因为注意到健康肌肤对美貌的重要性，SK-II浮世情怀彩妆系列中也推出护肤系列，包括洁肤、保湿及防止肌肤提早老化等产品。这些产品适用于各种肤质，并受到电影明星及一般消费者的喜爱。</div>\n<div>1930年出口部门设立后，SK-II扩大成为国际的化妆及护肤用品公司及品牌。1930至1940年代的第二次世界大战让亚洲区的业务暂停了一段时间，至1949年于日本及菲律宾重新开始运作，1950年代在于香港及新加坡恢复业务。台湾于1965年开始销售SK-II化妆品。</div>\n</div>','00e600a0a7de4d158098e54982608598','2016-09-27 14:28:01','00e600a0a7de4d158098e54982608598','2016-09-27 14:28:01',1),
	('713939265050451bb8e98e9f46ecc2ee','de8776f532034125ba594b72529f86b4','LANCOME兰蔻','/upload/00e600a0a7de4d158098e54982608598/606062a8fc624b63b01b379804a11791.jpg','始于1935年法国,欧莱雅集团旗下,兰蔻系列香水世界闻名,含苞欲放的玫瑰被誉为品牌标记,全球高端化妆品品牌','<div>\n<div>欧莱雅（中国）有限公司，LANCOME兰蔻，创立于1935年，法国国宝级的化妆品品牌，护肤/彩妆/香水领域高端品牌，其小黑瓶是全球首款以&ldquo;基因保养&rdquo;为主的精华肌底护肤产品</div>\n<div>&nbsp;</div>\n<div>兰蔻---法国国宝级的化妆品品牌，创立于1935年，迄今已有70多年历史。自创立伊始，就以一朵含苞欲放的玫瑰作为品牌标记。在近70年的时间里，兰蔻以其独特的品牌理念实践着对全世界女性美的承诺，给无数爱美女性带去了美丽与梦想。1993年兰蔻进驻中国。</div>\n<div>很多人都说，兰蔻的诞生起始于彩妆大师Armand Petitjean的一个华丽的梦，在梦的开端，有一地的玫瑰厚厚铺散，玫瑰的红搭配优雅的香，蔓延成一段精致的表演，Armand Petitjean便是这场表演的发起者，也是唯一的演绎者，他挥霍着自己独有的对美的灵感还有不断散发的热情，为美容界带来了一幕幕关于品牌，关于时尚的精彩。</div>\n<div>兰蔻香水，当芬芳泄进梦中</div>\n<div>对芬芳一直情有独钟的Armand Petitjean选择了用香水来开启自己完美的梦，1935年，他从5个有名的香料中提取灵感，大胆的创造了兰蔻的品牌。此举看似狂妄，却又和Armand Petitjean&ldquo;20世纪奢华香水之父&rdquo;的身份极为契合。1950年至1960年，兰蔻 (Lancome) 相继推出了Marrakech极品香水，Magie魔幻香水，Tresor真爱香水，这几款香水无论包装材料还是香氛都获得了巨大成功，确立了兰蔻 (Lancome) 在香水品牌中不可动摇的地位。兰蔻 (Lancome) 推出的Oceane产品系列 (1955)，该产品的概念至今仍然在使用：配方中含有非常纯净的海草，辅之以海藻和标记元素。这些革新在很大程度上要归功于 &ldquo;techniciennes&rdquo;，即那些毕业于兰蔻 (Lancome) 的学校并将兰蔻 (Lancome) 带到了世界各地的女性技术人员的努力。</div>\n<div>兰蔻护肤，梦是美丽在舞蹈</div>\n<div>兰蔻通过不断的科学研究实现了所有女人的梦想：对持久美丽的追求。1936年，兰蔻发布了著名的护肤系列NUTRIX,这一产品的滋养和活力配方被沿用至今，经久不衰。之后的1955年，兰蔻上市了一款新的护肤产品系列Oc&eacute;ane line，该系列产品蕴含极致纯净的海藻精华，这种独一无二的创新科技使得兰蔻品牌的科研声誉传遍全球。</div>\n<div>兰蔻彩妆，演奏梦的华彩</div>\n<div>兰蔻以其对女性的独特热爱创造出了Rose de France一款散发着保加利亚野玫瑰香味的粉色唇膏。这款有着18种不同颜色散发诱人芬芳的唇膏宛然是一件艺术的珍品，是彩妆世界中的一颗明珠。1975年，兰蔻 (Lancome) 第一款睫毛膏推出。兰蔻 (Lancome) 的睫毛膏至今仍处于世界行业领先地位，也是最畅销的单品。兰蔻 (Lancome) 的护肤品也是兰蔻 (Lancome) 最引以为傲的项目。微脂囊最早被兰蔻 (Lancome) 运用在1985年推出的新生日间修护霜当中，毫微胶囊分子则运用在1996年推出的再生青春修护液及再生青春眼霜中。这些高科技的保养品输送系统都由兰蔻 (Lancome) 率先应用在护肤品中，它们见证了兰蔻 (Lancome) 的高科技形象，强化了兰蔻 (Lancome) 在业界的领导地位。</div>\n<div>一支来自法国古堡的玫瑰，凭借着其盎然气质，在变幻莫测的女性心理间，在捉摸不定的时尚法则中，波澜不惊，足足绽放了六十年。</div>\n<div>这就是LANCOME的魅力，就像表情迷离内心坚韧的法国女人，无法让你放手。</div>\n<div>品牌LOGO</div>\n<div>LANCOME这一名称构想来自于法国中部的一座城堡LANCOSM。为发音之便，用一个典型的法国式长音符号代替了城堡名中的&ldquo;S&rdquo;字母。又由于&ldquo;兰蔻城堡&rdquo;的周围种植了许多玫瑰，充满浪漫意境，于是玫瑰花成为了兰蔻品牌的象征。品牌创始人Armand认为每个女人就像玫瑰，各有其特色与姿态。于是就以城堡命名品牌，玫瑰则成为了LANCOME的品牌标志。</div>\n<div>兰蔻最初的商标中有代表其三个系列的标志物：玫瑰，代表香水系列；莲花，代表护肤系列；天使，代表彩妆系列。</div>\n</div>','00e600a0a7de4d158098e54982608598','2016-09-27 14:26:55','00e600a0a7de4d158098e54982608598','2016-09-27 14:26:55',1),
	('772437f7a5d841228c404c8ea1d9516c','de8776f532034125ba594b72529f86b4','Dior迪奥','/upload/00e600a0a7de4d158098e54982608598/bfdaef1fb5ad4de185efb45c2bbb4e5a.jpg','始于1947年法国,其高级时装是华贵与高雅的代名词,蓝金唇膏/5色眼影为镇牌之宝,克丽丝汀迪奥商业(上海)有限公司','','00e600a0a7de4d158098e54982608598','2016-09-27 14:25:40','00e600a0a7de4d158098e54982608598','2016-10-25 12:56:15',1),
	('810f2adee9cd4159817268c8547585f0','cc797d97895d4363ad231bad0429815f','Bblaboratories ビービーラボラトリーズ','/upload/00e600a0a7de4d158098e54982608598/1ef193ce73cd4404b1667405feb43e51.png','Bb LABORATORIES（简称Bb-lab）是日本化妆品品牌，也是Biomarker System Creator日本上市集团综医研控股株式会社旗下的全资子公司，以研发、制造和贩售护肤品为主要事业，其中高端原液是其特色产品线。','','00e600a0a7de4d158098e54982608598','2016-07-08 17:50:42','00e600a0a7de4d158098e54982608598','2016-11-12 00:38:17',1),
	('81bb173d23844b10b3ae92d7fc0844b1','2cfee717036b44968c23f51dc1ee0c26','可莱丝/美迪惠尔','/upload/00e600a0a7de4d158098e54982608598/30b80c467a2742759850709083523aef.png','clinie可莱丝是韩国L&P(株)化妆品公司旗下护肤品牌。于2009年4月推出市场，随即引爆针剂面膜销售神话。2012年“clinie可莱丝“正式更名为”Mediheal美迪惠尔“。','','00e600a0a7de4d158098e54982608598','2016-09-27 14:31:13','00e600a0a7de4d158098e54982608598','2016-10-25 15:22:35',1),
	('abb2edaa9af64529bd0f2f79f3f44338','cc797d97895d4363ad231bad0429815f','城野医生','/upload/00e600a0a7de4d158098e54982608598/e2b3f86690474592a730a9a0e9be432c.png','城野医生（Dr.Ci:Labo）是日本第一医学美容品牌。它是由城野亲德医学博士在1999年於日本创立。城野医生对于科研的重视远远超过国内外大部分化妆品企业，城野医生在科研上的实力不仅体现在能找到消费者的需求，更能研发出符合消费者需求的产品。','','00e600a0a7de4d158098e54982608598','2016-10-25 15:52:26','00e600a0a7de4d158098e54982608598','2016-10-25 15:52:26',1),
	('cf71ecf7462e427eb72896fb4a4a6f09','cc797d97895d4363ad231bad0429815f','奥尔滨 ALBION','/upload/00e600a0a7de4d158098e54982608598/d4feb3f57e434065849cf4de11a1b41a.png','ALBIONはイギリスの古名で「White Land（白亜の国、白い国）を\n意味しており、グレートブリテン島の南部海岸をドーバー海峡から\n眺めると、白亜質の断崖が白く見えることに由来すると云われています。\n『白』は「女性の美の原点」との考えから、女性の永遠の夢であり、\n理想を追求する名前としてALBIONという社名になりました。\nまた、「日本一、世界一の高級品メーカーを目指す」という創業の夢が\n社名には込められています。','','00e600a0a7de4d158098e54982608598','2016-09-27 14:29:17','00e600a0a7de4d158098e54982608598','2016-10-25 16:29:21',1),
	('e239cc57b02944eca43ad59d9ba9cd67','de8776f532034125ba594b72529f86b4','YSL圣罗兰Yves Saint laurent','/upload/00e600a0a7de4d158098e54982608598/bec7447f9b1b433ab17afcb876e9b31a.png','YSL中文名为圣罗兰，是法国著名的奢侈品牌，主要有时装、护肤品，香水，箱包，眼镜，配饰等。伊夫圣罗兰先生1936年8月1日出生于法属北非阿尔及利亚，家境优渥，在成长过程中不乏接触高级时装珠宝的机会，久而久之累积酝酿起对于时装的热诚。17岁时只身前往时尚之都巴黎学习美术，不久后即转移到服装画的领域内。18岁时，他一举夺得时装设计比赛的冠军，被引荐到Christian Dior旗下工作，担任Dior的副手。','','00e600a0a7de4d158098e54982608598','2016-10-25 16:54:12','00e600a0a7de4d158098e54982608598','2016-11-10 02:26:14',1),
	('e642d25238ee4a12b0d92a6c5651e895','2cfee717036b44968c23f51dc1ee0c26','雅诗兰黛','/upload/00e600a0a7de4d158098e54982608598/a3789c4776b84cff98c8c4ef9e55bfb9.jpg','始于1946年美国,以护肤霜创业,YouthDew青春之露香水赢得品质优良的美誉,雅诗兰黛集团,拥有独特平衡性的品牌家族','<div>\n<div>雅诗兰黛（上海）商贸有限公司，创立于1946年美国，世界顶级化妆品牌，以抗衰修护护肤品闻名，小棕瓶修护家族/红石榴系列/多效智妍系列是其明星产品</div>\n<div>&nbsp;</div>\n<div>雅诗兰黛是美国雅诗兰黛公司旗下的化妆品旗舰品牌，成立于1946年纽约，以抗衰修护护肤品闻名。雅诗兰黛公司是全球领先的大型生产商和销售商。雅诗兰黛旗下的护肤，彩妆以及香氛产品都成为了科学与艺术完美结合的最佳范例。</div>\n<div>拥有护肤品品牌Clinique（倩碧） 、La Mer（海蓝之谜） 、LAB SERIES（朗仕）、Prescriptives、Origins（悦木之源） ，以及化妆品品牌Bobbi Brown、M&middot;A&middot;C，和男性香水品牌Aramis等等，同时，该公司也为7大美国顶级时装品牌，比如Donna Karan、Michael Kors等进行香水的贴牌生产。</div>\n<div>发展历程</div>\n<div>1946年，雅诗兰黛夫人凭借着想&ldquo;为每个女性带来美丽&rdquo;的渴望创立了雅诗兰黛品牌，并成立了以她名字命名的公司，同时推出了她的第一款产品：由她当化学家的叔叔研发的一瓶护肤霜。而在这面霜被最终贴上雅诗兰黛商标之前，它已经赢得了一群忠实粉丝。</div>\n<div>1953年，雅诗兰黛推出&ldquo;青春之露&rdquo;（YouthDew），这是一种香氛沐浴油，可以当香水使用。&ldquo;青春之露&rdquo;上市后大获成功，打破了法国香水一统天下的局面，使得高档香水不再是少数贵妇才能使用的奢侈品，而雅诗兰黛也获得了创新和优质的美誉。</div>\n<div>1964年推出男士香水和美容护肤产品。</div>\n<div>1968年建立倩碧（Clinique）实验室，研制生产经过抗敏试验，不含香精的美容护肤产品。</div>\n<div>1990年，为适应全球环保潮流，雅诗兰黛成立Origin有限公司，该公司研制的产品突出纯天然植物配方，不经动物实验，所有包装都可以回收利用。</div>\n</div>','00e600a0a7de4d158098e54982608598','2016-09-27 14:23:11','00e600a0a7de4d158098e54982608598','2016-09-27 14:23:11',1),
	('e77180aaf7eb4d32a62f723ae7198949','de8776f532034125ba594b72529f86b4','CHANEL 香奈儿','/upload/00e600a0a7de4d158098e54982608598/b6bd3bb12dff4bbcb1e7748190f70766.png','创始人Coco Chanel（原名：Gabrielle Bonheur Chanel ；中文名：加布里埃·可可·香奈儿）于1910年在法国巴黎创立香奈儿品牌。该品牌产品种类繁多，有服装、珠宝饰品及其配件、化妆品、护肤品、香水等，每一类产品都闻名遐迩，特别是香水与时装。 香奈儿（CHANEL）是一个有着整整百年历史的著名品牌，其时装设计永远保持高雅、简洁、精美的风格。Coco Chanel善于突破传统，早在20世纪40年代就成功地将“五花大绑”的女装推向简单、舒适的设计。','','00e600a0a7de4d158098e54982608598','2016-09-27 14:24:27','00e600a0a7de4d158098e54982608598','2016-10-25 16:42:48',1);
