" /><span style=\"color: #958d8d; font-family: \'Microsoft YaHei Light\', \'SimHei Medium\', sans-serif; font-size: 12px;\">其质地柔滑而不油腻，令肌肤细腻清爽。</span></div>','[]','00e600a0a7de4d158098e54982608598','2016-10-25 14:44:11','00e600a0a7de4d158098e54982608598','2016-11-16 17:53:51',1),
	('e958d500d46647f4b1393d8134803948','3622859f860f4ddfa0cc568abc4a0df3','4d4875e1ff0048558631dcf05f34d3f4','SK-II 肌源修护眼霜 15g','[\"/upload/00e600a0a7de4d158098e54982608598/9cafd1f0ab384fa9b7590809e58ab2db.png\",\"/upload/00e600a0a7de4d158098e54982608598/260063fd1fee4428b52ba35ec5382541.png\"]',480.00,1000,0,0,0,0,0,1,'<div>\n<h3 style=\"margin: 0px; padding: 14px 0px; border-width: 0px; border-top-style: none; font-family: Tahoma, Arial, Helvetica, \'Microsoft YaHei New\', \'Microsoft Yahei\', 微软雅黑, 宋体, SimSun, STXihei, 华文细黑, sans-serif; font-size: 16px; font-weight: bolder; line-height: normal; vertical-align: baseline; height: auto;\"><span style=\"font-size: 8pt;\">SK-II屡获殊荣的微肌因赋活修护系列，再创紧致抗皱新突破，推出全新微肌因修护焕采眼霜。</span></h3>\n<p style=\"margin: 0px 0px 20px; padding: 0px; border: 0px; font-family: Tahoma, Arial, Helvetica, 細明體, sans-serif; font-size: 1.4em; line-height: 19px; vertical-align: baseline;\"><span style=\"font-size: 8pt;\">特有微肌因赋活修护复合物*与浓缩PITERA&trade;**，并揉合棕榈酰五肽-4与小球藻萃取物的活力，为眼周肌肤注入源源不断的紧致能量，让双眸感觉更年轻。</span><br /><br /><span style=\"font-size: 8pt;\">微肌因修护焕采眼霜是一款质地轻柔的乳霜，易于被肌肤吸收。在滋润肌肤的同时，伴有淡淡清香。</span><br /><br /><span style=\"font-size: 8pt;\">源源紧致能量，让你大开眼界。</span><br /><br /><span class=\"disclaimer\" style=\"margin: 0px; padding: 0px; border: 0px; font-family: arial; font-size: 8pt; font-style: italic; font-variant-caps: inherit; line-height: inherit; vertical-align: baseline;\">* 水解大豆蛋白及水解酵母蛋白<br />** PITERA&trade;：为注册商标；指半乳糖酵母样菌发酵产物滤液&nbsp;</span></p>\n</div>','[]','00e600a0a7de4d158098e54982608598','2016-10-25 14:55:47','00e600a0a7de4d158098e54982608598','2016-11-16 17:53:39',1),
	('fab7cd7f221446b4a91be795b63f3d3f','3622859f860f4ddfa0cc568abc4a0df3','e642d25238ee4a12b0d92a6c5651e895','雅诗兰黛 石榴三件套（水200ml+洁面125ml+晚霜50ml）','[\"/upload/00e600a0a7de4d158098e54982608598/315c24f130df47fb891ce99514294c73.png\",\"/upload/00e600a0a7de4d158098e54982608598/45a5d821da5c4b36b59344bd758a3559.jpg\",\"/upload/00e600a0a7de4d158098e54982608598/7c6c338e4ac944e081412c8a29dd69f0.png\"]',0.01,1,0,1,0,0,0,1,'<h4 class=\"spp-product__details-header\" style=\"box-sizing: border-box; padding: 0px 0px 6px; margin: 0px 0px 38px 81.90625px; font-weight: normal; font-family: OptimaDisplayLight, \'Microsoft YaHei\', \'Microsoft JhengHei\', \'Hiragino Sans GB\', STHeiti, sans-serif, Tahoma, arial; font-size: 30px; letter-spacing: -0.005em; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc; width: 552.953125px;\"><span style=\"font-size: 12pt;\">产品详情&nbsp;</span></h4>\n<div class=\"spp-product__details-column spp-product__details-column01\" style=\"box-sizing: border-box; padding: 0px 0px 0px 81.90625px; margin: 0px; float: left; width: 675.828125px; font-family: AkzidenzGrotesk, \'Microsoft YaHei\', \'Microsoft JhengHei\', \'Hiragino Sans GB\', STHeiti, sans-serif, Tahoma, arial; font-size: 14px; letter-spacing: 0.75px;\">\n<div class=\"spp-product__details-description\" style=\"box-sizing: border-box; padding: 0px; margin: 0px 0px 20px; font-size: 15px;\">\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">Nutritious 雅诗兰黛鲜活亮采能量水，新升级革命性护肤理念&mdash;&mdash;「先排浊后润养」，净透，水亮，红润，滴滴直达年轻。</span></p>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">*全新红石榴果莓复合精粹，汲4大抗氧化圣果红石榴、蓝莓、枸杞、蔓越莓，经雅诗兰黛独家冷压萃取，生物发酵，倾注抗氧力，升级排浊力，环境损伤、累积浊质、疲惫黯沉逐一清空，肌肤回复原初健康透亮，焕活鲜亮光采。</span></p>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">滋润型--融入全新红石榴果莓复合精粹，Q润质地，滴滴晶莹凝于指尖，专为易干燥肌肤定制。滋宠每一寸干渴肌肤，更倾注多重抗氧排浊能量，自内驱散干燥、疲惫、黯沉，肌肤满注水盈，迸发鲜活亮采。</span></p>\n</div>\n<div class=\"spp-product__details-attribute\" style=\"box-sizing: border-box; padding: 0px; margin: 0px;\">\n<h5 class=\"spp-product__details-attribute__label\" style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 12px; letter-spacing: 0.15em; text-transform: uppercase;\"><span style=\"font-size: 8pt;\">使用方法</span></h5>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 15px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">倒适量精华水于掌心或化妆棉上</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">由内向外，从下向上涂抹于整个面部</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">轻拍按压至吸收</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">由下向上轻柔按摩整个面部</span></p>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 15px; line-height: 24px; letter-spacing: 0.05em;\">&nbsp;</p>\n<div class=\"spp-product__details-description\" style=\"box-sizing: border-box; padding: 0px; margin: 0px 0px 20px; font-size: 15px;\"><span style=\"font-size: 8pt;\">Nutritious 雅诗兰黛鲜活亮采晚霜，排浊，净透，滋润，滴滴直达年轻。</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">蕴含红石榴系列果莓复合精粹，汲4大抗氧化圣果红石榴、蓝莓、枸杞、蔓越莓，经雅诗兰黛独家冷压萃取，生物发酵，倾注抗氧力，升级排浊力，环境损伤、累积浊质、疲惫黯沉逐一清空，肌肤回复原初健康透亮，焕活鲜亮光采。</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">一瓶雅诗兰黛鲜活亮采晚霜相当于一瓶排浊晚霜+一瓶睡眠面膜，锁定夜晚肌肤自我修复\"黄金期\"，每晚如沁养睡眠面膜般润养，加乘排浊整夜不息，双效唤醒好气色！</span></div>\n<div class=\"spp-product__details-attribute\" style=\"box-sizing: border-box; padding: 0px; margin: 0px;\">\n<h5 class=\"spp-product__details-attribute__label\" style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 12px; letter-spacing: 0.15em; text-transform: uppercase;\"><span style=\"font-size: 8pt;\">使用方法</span></h5>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 15px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">每晚入睡前，在肌肤清洁和补水调理之后使用。搭配雅诗兰黛鲜活亮采系列洁面乳和果粹水使用效果更佳。</span></p>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 15px; line-height: 24px; letter-spacing: 0.05em;\">&nbsp;</p>\n<div class=\"spp-product__details-description\" style=\"box-sizing: border-box; padding: 0px; margin: 0px 0px 20px; font-size: 15px;\">\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">全新上市 Nutritious 雅诗兰黛鲜亮焕采泡沫洁面乳，新升级革命性护肤理念&mdash;&mdash;「先排浊后润养」。净透，水亮，红润，滴滴直达年轻。</span></p>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">蕴含强吸附力\"磁性粘土\"，两分钟内厚敷成膜，深入肌肤里层清洁，帮助肌肤排出浊质，由内及外透现鲜亮光采。蕴含冷压萃取8维莓果粹，赋活双倍肌肤排浊力，3分钟唤醒透亮肌肤。</span></p>\n</div>\n<div class=\"spp-product__details-attribute\" style=\"box-sizing: border-box; padding: 0px; margin: 0px;\">\n<h5 class=\"spp-product__details-attribute__label\" style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 12px; letter-spacing: 0.15em; text-transform: uppercase;\"><span style=\"font-size: 8pt;\">使用方法</span></h5>\n<p style=\"box-sizing: border-box; padding: 0px; margin: 0px; font-size: 15px; line-height: 24px; letter-spacing: 0.05em;\"><span style=\"font-size: 8pt;\">作为泡沫洁面乳：早晚取适量，温柔按摩湿润肌肤，之后洗净。</span><br style=\"box-sizing: border-box; padding: 0px; margin: 0px;\" /><span style=\"font-size: 8pt;\">作为抗氧化面膜使用：一周两次 （可视情况而定），轻敷数分钟，排出浊质，令肌肤倍感清新舒适，效果显著。</span></p>\n</div>\n</div>\n</div>\n</div>','[]','00e600a0a7de4d158098e54982608598','2016-10-25 14:18:17','00e600a0a7de4d158098e54982608598','2016-11-16 17:54:00',1),
	('fc1bbd1501ac4b18ab603400bbceb0ee','cc3af4741ada4fb89a6fce61bb6b75a4','e239cc57b02944eca43ad59d9ba9cd67','YSL圣罗兰 纯口红 方管 52（星星色）','[\"/upload/00e600a0a7de4d158098e54982608598/7e9aa6f7168444de9c63494c7ba34f62.png\"]',240.00,1000,1,0,0,0,0,1,'<div><span style=\"color: #666666; font-family: SimHei, sans-serif; font-size: 14px;\">&ldquo;红色是一种宣言，是存在的证明，是女性气质充满张力的演绎。&rdquo;圣罗兰纯口红，真正为优雅美丽高级定制的口红！融合纯正色彩、耀眼光泽和滋润质地于一身，赋予双唇丝缎般细腻与浓郁的色泽质感。金色方管高定设计，如珠宝般纯粹高贵。无论是身穿优雅晚装或时尚便服，圣罗兰纯口红都能搭配不同形象，成为隐藏于手袋内的一个美妆法宝。</span><br style=\"box-sizing: border-box; color: #666666; font-family: SimHei, sans-serif; font-size: 14px;\" /><br style=\"box-sizing: border-box; color: #666666; font-family: SimHei, sans-serif; font-size: 14px;\" /><span style=\"color: #666666; font-family: SimHei, sans-serif; font-size: 14px;\">YSL方管口红中含有大量的精华保湿成分（滋润和抗氧化因子），由于温度较大的变化会产生少许的水珠, 属于正常的物理现象, 不会影响唇膏的质量和使用效果, 完全不必担心。</span></div>','[]','00e600a0a7de4d158098e54982608598','2016-10-25 17:06:31','00e600a0a7de4d158098e54982608598','2016-11-16 18:17:18',1);
